import {AppBar,Toolbar,styled} from '@mui/material';

const Header=styled(AppBar)`
background:#111111
`

const NavBar=()=>{
    return(
       <Header>
        <Toolbar>
           <p>Code for Interview</p>
           <p>AllUser</p>
           <p>Adduser</p>
        </Toolbar>
       </Header>
    )
}

export default NavBar;
